import "./Header.css";
import React, { useState } from "react";
import { Typography, Button, Divider, Box, Grid, Tabs, Tab } from "@mui/material";
import logo from "../asset/logo.png";
import { Navigate } from "react-router-dom";
import { styled } from '@mui/material/styles';



function Header() {
    const StyledTabs = styled((props) => (
        <Tabs
          {...props}
          TabIndicatorProps={{ children: <span className="MuiTabs-indicatorSpan" /> }}
        />
      ))({
        '& .MuiTabs-indicator': {
          display: 'flex',
          justifyContent: 'center',
          backgroundColor: 'transparent',
        },
        '& .MuiTabs-indicatorSpan': {
          maxWidth: 40,
          width: '100%',
          backgroundColor: 'red',
        },
      });

      const StyledTab = styled((props) => <Tab disableRipple {...props} />)(
        ({ theme }) => ({
          textTransform: 'none',
          fontWeight: theme.typography.fontWeightRegular,
          fontSize: theme.typography.pxToRem(15),
          marginRight: theme.spacing(1),
          color: 'black',
          '&.Mui-selected': {
            color: 'red',
          },
          '&.Mui-focusVisible': {
            backgroundColor: 'rgba(100, 95, 228, 0.32)',
          },
        }),
      );
    const [value, setValue] = useState(0);

    const handleChange = (event, newValue) => {
      setValue(newValue);
      Navigate("/login");
    };
    const menuClick = () => {
        Navigate('/login');
    }
  return (
    <>
      <div id="header">
        <Box
          sx={{
            display: "grid",
            alignItems: "center",
            width: "100%",
            borderRadius: 1,
            color: "text.secondary",
            "& svg": {
              m: 1.5,
            },
            "& hr": {
              mx: 0.5,
            },
          }}
        >
          <Grid container spacing={10}>
            <Grid item xs={1}>
              <Typography align="left">
                <a href="/">
                  <img
                    href="/"
                    src={logo}
                    style={{ marginTop: "0%", height: "40px" }}
                  ></img>
                </a>
              </Typography>
            </Grid>
            <Grid item xs={1}>

            </Grid>
            <Grid item xs={7}>
            <StyledTabs value={value} onChange={handleChange} aria-label="full width tabs example" variant="fullWidth" indicatorColor="secondary">
                <StyledTab label="HOME" onClick={menuClick}>
                <Button>
                HOME
                </Button>
                </StyledTab>
                <StyledTab label="CREATE" onClick={<a href="/create"></a>}>
                <Button>
                Create
                </Button>
                </StyledTab>
                <StyledTab label="CHART">
                <Button>
                CHART
                </Button>
                </StyledTab>
                <StyledTab label="BOARD">
                <Button>
                BOARD
                </Button>
                </StyledTab>

            </StyledTabs>
            </Grid>

            <Grid item xs={1}>
            <Divider/>
            </Grid>

            <Grid item xs={2}>

              <Button align="right">
                <a href="/login">로그인</a>
              </Button>
            </Grid>
          </Grid>
        </Box>
      </div>
    </>
  );
}

export default Header;
